INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES ("クリア", 1, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 126001, 24001, 0, 325, 2, 5, 40011, 2);
